import React from 'react';

function Profile() {
  const user = {
    name: "AnagaShri",
    email: "anagashri@example.com"
  };

  return (
    <div className="text-center mt-5">
      <img
        src="profile.png"
        alt="User"
        className="rounded-circle mb-3"
      />
      <h3>{user.name}</h3>
      <p>{user.email}</p>
    </div>
  );
}

export default Profile;
